import React, { Component } from 'react'
import {Spring} from 'react-spring/renderprops'
export default class Fold extends Component {
  render() {
    return (
      <div>
        <Spring
  from={{ opacity: 0 }}
  to={{ opacity: 1 }}>
  {props => <div style={props}>hello</div>}
</Spring>
      </div>
    )
  }
}
